local isFrozen = false
local defaultSpeed = 16
local speed = defaultSpeed
local moveConnection

local function toggleFreeze()
    local character = LocalPlayer.Character
    if not character then return end

    local humanoidRootPart = character:FindFirstChild(xyNnvxmdBmPPLRFuxtYPLTpbybGcyLqskoKWRlebMOVTXS(''))
    local humanoid = character:FindFirstChildOfClass(xyNnvxmdBmPPLRFuxtYPLTpbybGcyLqskoKWRlebMOVTXS(''))

    if humanoidRootPart and humanoid then
        if not isFrozen then
            humanoidRootPart.Anchored = true
            moveConnection = l.RenderStepped:Connect(function()
                if isFrozen then
                    humanoidRootPart.CFrame = humanoidRootPart.CFrame + (humanoid.MoveDirection * speed / 60)
                end
            end)
            isFrozen = true
            e.Text = xyNnvxmdBmPPLRFuxtYPLTpbybGcyLqskoKWRlebMOVTXS('')
        else
            humanoidRootPart.Anchored = false
            humanoid.WalkSpeed = defaultSpeed
            isFrozen = false
            e.Text = xyNnvxmdBmPPLRFuxtYPLTpbybGcyLqskoKWRlebMOVTXS('')
            if moveConnection then moveConnection:Disconnect() end
        end
    end
end

